<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:1.0in;text-indent:-.25in;mso-outline-level:3;mso-list:l0 level2 lfo1;\r\ntab-stops:list 1.0in"><span style="font-family:"Arial","sans-serif";\r\nmso-fareast-font-family:Arial;mso-bidi-language:AR-LB;mso-bidi-font-weight:\r\nbold"><span style="mso-list:Ignore">•<span style="font:7.0pt "Times New Roman"">      \r\n</span></span></span><span dir="LTR"></span><b><span style="mso-bidi-language:\r\nAR-LB">Apply best practice frameworks to design your own mission, vision, and\r\nvalues </span></b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>Day 2: The theory of change</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:.5in;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level1 lfo2;tab-stops:list .5in"><span style="font-family:"Arial","sans-serif";mso-fareast-font-family:Arial;\r\nmso-bidi-language:AR-LB;mso-bidi-font-weight:bold"><span style="mso-list:Ignore">•<span style="font:7.0pt "Times New Roman"">       </span></span></span><span dir="LTR"></span><b>Learning Objectives</b><b><span style="mso-bidi-language:\r\nAR-LB"></span></b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:1.0in;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level2 lfo2;tab-stops:list 1.0in"><span style="font-family:"Arial","sans-serif";mso-fareast-font-family:Arial;\r\nmso-bidi-language:AR-LB;mso-bidi-font-weight:bold"><span style="mso-list:Ignore">•<span style="font:7.0pt "Times New Roman"">       </span></span></span><span dir="LTR"></span><b>Identify the activities that will lead to your social venture’s\r\noutcomes</b><b><span dir="RTL" style="font-family:"Arial","sans-serif";\r\nmso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:\r\nCalibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:Arial;mso-bidi-theme-font:\r\nminor-bidi;mso-bidi-language:AR-LB" lang="AR-LB"></span></b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:1.0in;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level2 lfo2;tab-stops:list 1.0in"><span style="font-family:"Arial","sans-serif";mso-fareast-font-family:Arial;\r\nmso-bidi-language:AR-LB;mso-bidi-font-weight:bold"><span style="mso-list:Ignore">•<span style="font:7.0pt "Times New Roman"">       </span></span></span><span dir="LTR"></span><b>Use a theory of change to highlight how your venture will\r\ncreate positive outcomes</b><b><span dir="RTL" style="font-family:\r\n"Arial","sans-serif";mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;\r\nmso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\r\nArial;mso-bidi-theme-font:minor-bidi;mso-bidi-language:AR-LB" lang="AR-LB"></span></b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>Day 3: Humanitarian and social\r\nchallenges in Lebanon </b></p>\r\n\r\n<p class="MsoListParagraph" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;mso-add-space:auto;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level1 lfo2;tab-stops:list .5in"><span style="font-family:"Arial","sans-serif";mso-fareast-font-family:Arial;\r\nmso-bidi-font-weight:bold"><span style="mso-list:Ignore">            •<span style="font:7.0pt "Times New Roman"">       </span></span></span><span dir="LTR"></span><b>Learning Objectives:</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:1.0in;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level2 lfo2;tab-stops:list 1.0in"><span style="font-family:"Arial","sans-serif";mso-fareast-font-family:Arial;\r\nmso-bidi-font-weight:bold"><span style="mso-list:Ignore">•<span style="font:7.0pt "Times New Roman"">       </span></span></span><span dir="LTR"></span><b>Identify the main actors working in development and\r\nhumanitarian sector in Lebanon and how they work to solve social problems</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;margin-left:1.0in;text-indent:-.25in;line-height:normal;mso-outline-level:\r\n3;mso-list:l1 level2 lfo2;tab-stops:list 1.0in"><span style="font-family:"Arial","sans-serif";mso-fareast-font-family:Arial;\r\nmso-bidi-font-weight:bold"><span style="mso-list:Ignore">•<span style="font:7.0pt "Times New Roman"">       </span></span></span><span dir="LTR"></span><b>Understand the main challenges faced on the field and how\r\nsocial innovation can help to face these challenges </b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b><u>Module 2: Practice field\r\nTraining (2 days) </u>- immersive experience through accompanying the team of a\r\nnon-profit organization on the field (the trainee will be able to choose an\r\norganization that responds to its field of interest)</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>Day 1: </b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>- Get to know the non-profit\r\norganization mission, its programs and meet with the team</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>- Accompany the team on the\r\nfield and write a brief on your observations</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>Day 2: </b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>- Accompany the team on the\r\nfield</b></p>\r\n\r\n<p class="MsoNormal" dir="LTR" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:\r\nauto;line-height:normal;mso-outline-level:3"><b>- Write a brief on your\r\nobservations</b></p>\r\n\r\n', 1),
