SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"/>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><b><span style="mso-bidi-language:AR-LB">Maroun\r\nMikhael is founder and trainer at Edokio. </span></b><b><span style="mso-ansi-language:FR;mso-bidi-language:AR-LB" lang="FR">Maroun </span></b><b><span style="mso-bidi-language:AR-LB">is also the director of Lebanese Center for\r\nCivic Education, a non-profit based in Lebanon that works since 2007 on\r\nempowering youth to become change makers, and to fulfill their potential to\r\nparticipate in civic, social, and economic development in their communities.</span></b></p><p><b><span style="mso-bidi-language:AR-LB"><br></span></b>\r\n\r\n<p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:3"><b><span style="mso-bidi-language:AR-LB">Since\r\nmore than seven years, Maroun has been managing programs that reached thousands\r\nof youth living in vulnerable communities in order to develop their capacities\r\nto become financially independent and fully participate in the society. He\r\nmanaged activities including vocational and entrepreneurship trainings, life\r\nskills empowerment, as well as social cohesion and peace building initiatives.</span></b></p><p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:3"><b><span style="mso-bidi-language:AR-LB"><br></span></b></p>\r\n\r\n<p class="MsoNormal" style="mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\nline-height:normal;mso-outline-level:3"><b><span style="mso-bidi-language:AR-LB">Maroun\r\nhas previous experiences as a program manager and as a management consultant in\r\nleading private sector organizations. He graduated with specialized masters\r\nfrom ESCP-Europe in 2008.</span></b></p>\r\n\r\n</p>', 1),
