INSERT INTO `posts` (`Id`, `Title`, `Content`, `Date`, `file_url`) VALUES
(17, 'Promising ', '<p>Moving towards a greener economy is creating opportunities for new technologies, investment and jobs.</p><p>\r\n\r\nMany factors make the green jobs on demand, such as the rising concern on climate change issue, more awareness on ecological approach respecting the environment.</p><p>\r\n\r\nSkill shortages already constrain the transition to a greener economy. Here are two promising occupations in the green jobs field:</p><p>- Photovoltaic systems installer and maintainer: in this position you will assemble, install, and maintain solar panel systems on rooftops or other structures.</p><p>\r\n\r\nAlthough most installers need a high school diploma and typically receive on-the-job training lasting up to 1 year, some candidates who take courses at a technical school or receive vocational training will be able to fulfill this position.</p><p>\r\n\r\n- Solar project manager: as solar project manager, you’ll be responsible for project management and project development from site acquisition to construction, financing, and handover to construction.</p><p>\r\n\r\nFor this position, you’ll need five or more years of technical experience and a master’s degree in engineering, or business will be a plus.</p><p>\r\n\r\nThe continued expansion and adoption of renewable energy alternatives will result in excellent job opportunities, particularly for those who complete training courses on solar panel installation.</p><p>\r\n\r\nEdokio develops training specific for the green energy sector in order to Equip young people entering the labor market and older workers mid-way through their careers with the ability to learn the skills required for adopting new technologies, meeting new environmental regulations, and shifting to renewable sources of energy.</p>', '2021-10-18', 'solar.jpg'),
