(7, 'مافين فانيليا', 1, 1, 10, '2020-09-15 10:55:03', 13, 'MafineVanilia.mp4', '', '"""زبدة	غرام	40.5<br>سكر بودرة	غرام	60<br>طحين	غرام	81<br>كاكاو	غرام	15<br>باكن بودر	غرام	12<br>بيض	غرام	54<br>فانيليا	غرام	1<br>طريقة التحضير<br>نضع الزبدة والسكر البودرة في الوعاء ونبدء بالعجن حتى تصبح عجينة ناعمة <br>ثم نضيف باقي المواد الناشفة وتعجن الى ان تصبح عجينة متناسقة ثم نضيف البيض ونكمل العجن دون الاكثار من العجن كي لا  تذوب العجينة <br>نحضر القالب بالدهن بالزبدة ثم ترش بالطحين جيدا أو نضع الورق الخاص بالمافين ونضع الخليط <br>نحمي الفرن على حرارة 180 درجة مئوية  ونضع القالب مدة ربع ساعة <br> يفحص القالب اذا نشف بواسطة قشة كبريت او مسواك ويترك في الفرن الى ان تنشف من الداخل<br>تخرج المافين من الفرن وتوضع جانبا الى ان تبرد"""', 'Arabic', NULL, NULL, 0),
(8, 'عجينة الكريب', 1, 1, 10, '2020-09-15 10:55:57', 13, 'crepe.mp4', '', 'طحين	غرام	375<br>باكن بودر	غرام	10<br>ملح	غرام	0.5<br>فانيليا 	غرام	1<br>سكر	غرام	110<br>زبدة	غرام	45<br>بيض 	بيضة 	2<br>حليب سائل	غرام	250<br>طريقة التحضير<br>نضع الطحين في وعاء , نضيف فوقه السكر الملح ثم الباكن بودر والفانيليا  <br>نخلط المكونات جيدا ثم نضيف الحليب السائل والبيض ثم الزبدة الذائبة ونعجن الخليط جيدا <br>الى ان نحصل على خليط ناعم جدا <br>تريح العجينة في البراد مدة نصف ساعة ثم نحمي مقلاة تدهن بالزيت او الزبدة ونضع العجينة <br>بنفس طريقة القطايف وتقلب الى الناحية الثانية بعد ان تشقر من اول ناحية <br>توضع على حدة . تقدم ساخنة او باردة مع شراب التفاح المطبوخ او العسل او المربيات او الزبدة ', 'Arabic', NULL, NULL, 0),
(9, 'عجينة التارت و السابليه', 1, 1, 10, '2020-09-15 10:57:21', 13, 'TarteAndSable.mp4', '', 'نضع المواد الناشفة مع بعضها ونفركها مع الزبدة ثم نعجنها مع البيض تدريجيا الى ان نحصل على عجينة ناعمة ومتماسكة ثم تريح في البراد مدة ساعة ثم نخرجها ونرقها حسب الطلب وتترك جانبا الى ان نحمي الفرن على حرارة 180 درجة وتخبز الى ان تشقر ثم تترك لتبرد ونحشيها حسب الرغبة وتزين وتقدم باردة  ', 'Arabic', NULL, NULL, 0),
(10, 'عجينة المناقيش', 1, 1, 10, '2020-09-15 10:57:51', 13, 'man2oushe.mp4', '', 'طحين 	غرام	200<br>زبدة	غرام	20<br>خميرة	غرام	3<br>ماء فاتر	غرام	100<br>سكر	غرام	10<br>ملح	غرام	4<br>الحشوة <br>زعتر جاهز 	غرام	50<br>زيت نباتي 	غرام	80<br>طريقة التحضير<br>نضع الطحين في وعاء ونضيف اليه الزبدة وتفرك جيدا , ثم نضيف السكر والملح والخميرة وتخلط المواد <br>جيدا ثم نضيف الماء تدريجيا حسب الحاجة وتعجن جيدا الى ان تصبح عجينة ناعمة . <br>ثم تغطى بورقة نايلون او فوطة وتترك الى ان تخمر ثم تقطع حسب الرغبة وتريح قليلا تم تمد بالشوبك <br>وتوضع جانبا الى ان تخمر ثانية , ثم نضع عليها المواد كل الزعتر او الجنة او اللحمة وغيرها  <br>ثم تدخل الى الفرن الحامي الى ان تنضج ', 'Arabic', NULL, NULL, 0),
(11, 'كوكيز', 1, 1, 10, '2020-09-15 10:59:11', 13, 'whitecookies.mp4', '', 'زبدة	غرام	60<br>سكر	غرام	70<br>بيض = نصف بيضة 	غرام	30<br>طحين	غرام	90<br>كاكاو	غرام	15<br>ملح	غرام	1<br>كاربونة	غرام	1<br>فانيليا	غرام	1<br>طريقة التحضير<br>نضع الزبدة ثم السكر ونخلط جيدا <br>ثم نضيف باقي المواد الناشفة  الى ان تصبح العجينة متماسكة <br>ثم نضيف البيض ونعجن الخليط الى ان تصبح العجينة متماسكة <br>تريح العجينة في البراد ثم تقطع حسب الرغبة وتوضعة في الصينية على ورق زبدة وتدخل الفرن<br>نحمي الفرن على حرارة 180 درجة مئوية  ونضع الصينية  مدة ربع ساعة او الى ان تنشف جيدا<br>تخرج من الفرن وتترك لتبرد وتقدم مع المشروبات الساخنة او الباردة حسب لاذوق', 'Arabic', NULL, NULL, 0),
(12, 'تارت', 1, 1, 10, '2020-09-15 11:00:13', 21, 'Tarte.mp4', '', 'ؤ	غرام	75<br>زبدة	غرام	150<br>طحين	غرام	300<br>بيض	غرام	90<br>فانيليا	غرام	1<br>باكن بودر 	غرام	2<br>تفاح	كيلوغرام	1.5<br>سكر	غرام	500<br>قرفة بودرة	غرام	8<br>طريقة التحضير<br>نضع الزبدة والسكر البودرة في وعاء ونخلط جيدا  ثم نضيف باقي المواد الناشفة <br>نعجن جيدا ثم نضيف البيض ونعجن الخليط الى ان تصبح العجينة ناعمة ثم نضعها في البراد مدة ساعة <br>نقشر نصف كمية التفاح ويفرم ناعما ثم نضع ثلثين كمية السكر على النار ويترك على النار الى ان يشقر <br>نضيف فوقه التفاح المقطع ويترك على نار خفيفة مع التحريك الى ان يستوي وتشف الماء <br>نمد العجينة على الطاولة مع القليل من الطحين وتوضع في القالب الملبس بورق الزبدة وتبخش بالشوكة <br>يحمى الفرن على حرارة 180 درجة او رقم 7 ثم يخفخف على رقم 6 او 160 درجة ونضع القالب مدة 15 دقيقة <br>يخرج من الفرن ونضع التفاح المطبوخ في القالب تم نضع التفاح المقشر والمقطع رفيعا ثم يرش بباقي السكر مع القرفة ويعاد الى الفرن ويكمل الاستواء الى ان يشقر  وجه القالب تقريبا  ', 'Arabic', NULL, NULL, 0),
(13, 'كوكيز الشوكولا', 1, 1, 10, '2020-09-15 11:00:55', 13, 'chococookiesrecipe.mp4', '', 'زبدة	غرام	60<br>سكر	غرام	70<br>بيض = نصف بيضة 	غرام	30<br>طحين	غرام	90<br>كاكاو	غرام	15<br>ملح	غرام	1<br>كاربونة	غرام	1<br>فانيليا	غرام	1<br>طريقة التحضير<br>نضع الزبدة ثم السكر ونخلط جيدا <br>ثم نضيف باقي المواد الناشفة  الى ان تصبح العجينة متماسكة <br>ثم نضيف البيض ونعجن الخليط الى ان تصبح العجينة متماسكة <br>تريح العجينة في البراد ثم تقطع حسب الرغبة وتوضعة في الصينية على ورق زبدة وتدخل الفرن<br>نحمي الفرن على حرارة 180 درجة مئوية  ونضع الصينية  مدة ربع ساعة او الى ان تنشف جيدا<br>تخرج من الفرن وتترك لتبرد وتقدم مع المشروبات الساخنة او الباردة حسب لاذوق', 'Arabic', NULL, NULL, 0),
(14, 'بيتزا', 1, 3, 10, '2020-09-15 11:01:37', 13, 'pizzadoughrecipe.mp4', '', '200<br>3<br>4<br>3<br>30<br>100<br>طريقة التحضير<br>نضع المكونات الناشفة في وعاء العجن ونضيف الماء تدريجيا الى ان نحصل على عجينة ناعمة <br>على ان لا تلتصق في اطراف العجانة او الوعاء تغطى بورقة نايلون وتترك ترتاح لتختمر مدة سعة او اكثر <br>الى ان تصبح العجينة مختمرة , نمد العجينة على طاولة العمل مع رش الطحين على الطاولة كي لا <br>تلتصق العجينة . <br>نلف العجينة على الشوبك ثم نمدها على الصينية ونكمل المد باليد الى ان تأخذ شكل الصينية <br>تريح مدة نصف ساعة ثم تشك بالشوكة ونكون حمينا الفرن على حرارة 180 در مدة 10 دقائق <br>نضع المكونات على العجينة وندخلها الى الفرن الى أن يشقر الكعب والوجه تخرج من الفرن وتقطع ', 'Arabic', NULL, NULL, 0),
