(19, 'مهارات المندوب', 1, 1, 10, '2020-09-30 08:21:03', 18, 'customerserviceskills1.mp4', '', '""لتبرع في مهامك في خدمة الزّبائن يجب أن تتحلّى بهذه الطّباع، إذ هي المفتاح السّرّي لنجاح العمل :<br>‌أ-	الإصغاء : من المهمّ للطّرفين، التّمتّع بالإصغاء بحيث أنّه يكفل لك فهم الزّبون وعرض له الحلّ أو الخيار الأفضل لتساؤلاته.<br>‌ب-	مهارات الإقناع : يجب عليك دائمًا أن تضع هدفًا أساسيًّا أمامك وهو إقناع الزّبون بأنّ ما لديك هو أفضل ما يناسبه. ولهذا ممكن استخدام سبل الإقناع المختلفة والتّفاوض والشّرح، إلخ...<br>‌ج-	معرفة المنتج : لكي تبرع في عمليّة الإقناع والشّرح والإجابة على تساؤلات الزّبائن، يجب أن تؤمّن إلمامًا شاملًا وواسعًا للمنتج وكافّة المنتجات المشابهة. من هنا يبدأ سرّ النّجاح.<br>‌د-	إدارة الوقت : عندما يطرأ عليك نزاع مع الزّبون أو عدم قدرتك لمساعدته بشكلٍ بنّاء، من الأفضل أن تقوم بتوجيهه إلى زميلٍ لك أو قسم متخصّص لحلّ المشكلة وعدم إضاعة وقتك والزّبون.<br>‌ه-	اللّغة الإيجابيّة : إنّ معظم عمليّة إقناعك للزّبون وحلّ مشكلاته تكمن في طريقة الكلام واللّغة السّليمة والإيجابيّة الَّتي تستخدمها معه.<br>‌و-	الإستعداد للتّعلّم : يجب أن تتحلّى دائمًا بروح الفضول والتقدّم وأن تقبل لا بل تسعى بنفسك إلى التّطوّر والتّعلّم المستدام ومقاربة باقي المنتجات من منتجك لتشكلّ صورة واضحة دائمًا لنفسك.<br>‌ز-	الإصرار والتّمسّك : الحافز الأساسيّ لنجاحك في هذا العمل هو ثقتك بنفسك. يجب أن تثق بأنّ ما تقوله صحيح وتصرّ دائمًا على إيجاد الحلول لتخلق جوًّا من الرّاحة والطّمأنينة مع الزّبون.<br>‌ح-	الصّبر : إن لم يكن لديك روح الصّبر لتحمّل الزّبون وأرباب عملك فلن تستطيع إتمام هدفك بالشّكل المطلوب.<br>""', 'Arabic', NULL, NULL, 0),
(20, 'شخصيّات الزّبائن', 1, 1, 10, '2020-09-30 08:27:35', 18, 'customerserviceclientpersonality2.mp4', '', '"لتكون خدمتك فعّالة، من المهمّ جدًّا أن تتعرّف على زبونك. إليك أهمّ أنواع الزّبائن وكيفيّة التّعامل معهم :<br>‌أ-	الصّامت : <br>إنّه الشّخص الأكثر صعوبةً بحيث أنّه يرفض التّواصل والتّحدّث معك ولا يظهر أيّة ردّة فعل.<br>الحلّ ؟ يجب أن تخرق صمته بطرح أسئلة لا تتطلّب الإجابة بنعم أو لا بل بأجوبةٍ طويلة.<br><br>ب‌-	الثّرثار :<br>يحبّ الكلام والمجادلة والنّقد. قد يكون غير منطقي في ردوده.<br>الحلّ ؟حاول دائمًا أن تمسك بالحديث وتعيده إلى المسار الأساسيّ بلباقة واحترام، ولا تحاول إسكاته.<br><br>ج‌-	المجادل :<br>يهوى إثارة المشاكل ويجد انتقادًا على كلّ ما تقوله.<br>الحلّ ؟ يجب عليك أن تتحلّى بالصّبر، واستخدام مهارات الإقناع وعرض الحلول.<br><br>د‌-	المشكّك :<br>لا يصدقّ ما تقوله، ناقدًا، غير لبق، في نظراته الشكّ دائمًا.<br>الحلّ ؟يحتاج هذا النّوع إلى المستندات والإثباتات الملموسة دائمًا (ليس فقط الكلام). قد تلجأ إلى تقديم له ضمانات معيّنة كالكفالة.<br>ه- المتردّد :<br>لا يستطيع أن يتّخذ قرارًا بسهولة، لديه نقص في التّركيز، يفتقد بعض الثّقة بالنّفس وغالبًا ما يكون خجولًا.<br>الحلّ ؟ اتّبع الشرح المنطقيّ والبنّاء. أعطِهِ الوقت الكافي للاقتناع وتثبيت الأفكار في ذهنه.<br><br>و‌-	المستعجل :<br>غير صبور، يحتاج إلى تنفيذ أعماله وإنهائها في اللّحظة. سريع الغضب، يحبّ الإهتمام حتّى على حساب الآخرين.<br>الحلّ ؟ السّرعة والجودة العالية في تقديم الحلول والعروض. <br>"', 'Arabic', NULL, NULL, 0),
(22, 'دراسة السّوق', 1, 1, 10, '2020-10-06 13:06:30', 17, 'MKTmarket2.mp4', '', '"دراسة السوق مهمة جدّا قبل البدء بالتسويق.<br><br>إذ أنها ضرورية لمعرفة الأمور التالية:<br>- من هم الزبائن<br>- هل سيلبي المنتج حاجة الزبائن بطريقة أفضل من المنافسين<br>-  هل سيكونون مهتمين للمنتج<br>- هل هم مستعدون لدفع السعر الذي سيتيح لك تحقيق الربح الذي تريده"', 'Arabic', NULL, NULL, 0),
