(29, 'معالجة الشّكاوى', 1, 1, 10, '2020-10-07 06:20:59', 18, 'customerservicecomplaints3.mp4', '', '"الجزء الأوَّل من معالجة الشّكاوى : الإصغاء وفهم المسألة<br>-	الإستماع بشكلّ جيّد إلى مشكلة / حاجة العميل لتقديم الحلّ الأفضل<br>-	إعادة ما قاله العميل لتتأكَّد أنّك فهمت<br>-	عدم اعتراض العميل والشّكوى لئلّا يشعر أنه مرفوض. (الزّبون دائمًا على حقّ).<br>-	طرح المزيد من الأسئلة والاستفسارات لتكوين صورة كاملة وواضحة <br>عن تساؤلاته<br><br>الجزء الثّاني من معالجة الشّكاوى : حلّ المسألة.<br>1- الإعتذار بصدق : بادر بإقرار الخطأ لتقترب من وجهة العميل وتظهر أنّك لست عدوًّا له. تحرَّ عن سبب المشكلة أوَّلًا قبل تحديد صفّك.<br>2- التّعاطف مع المشكلة :  ضَع نفسك مكان العميل وتصرّف على هذا الأساس.<br>3- الاستفسار عمّا يريد العميل:  إفهم من العميل ماذا يريد قبل عرض الحلّ أو البديل له. <br>4- تطمين العميل أنّ مشكلته ستُحَلّ : أوضح للعميل أنّك ستصل إلى حلٍّ يرضي الطّرفين.<br>5- بذل جهدك لحلّ المشكلة :  إذا كان طلب العميل ممكنًا نفّذه للحال. إذا لن تستطيع تنفيذه قدّم حلًّا بديلًا واقطع وعدًا لتاريخ إتمام العمليّة. لا تنسَ : إنّه وعد! <br>6- شكر العميل : عبّر للعميل عن امتننانك أنه شارك مشكلته مع الشّركة. أخبرْ العميل أنّك تشرّفت بلقائه وستكون مسرورًا بخدمته في كافّة الأوقات.<br>7- متابعة العميل : قم بمراسلة العميل هاتفيًّا أو إلكترونيًّا للتّأكّد أنّ كلّ شيء على ما يرام ولا يعاني من أيّة مشاكل مجدّدة.<br>8- تسجيل تفاعلات الشّكوى : قم بتسجيل كلّ ما جرى خلال تقديم الشّكوى وحلّها ومن ثمّ ثمْ بأرشفة هذه الشكاوي في سجلّات مخصّصة لذلك الهدف بغية تحسين الخدمة قدر المستطاع.<br>"', 'Arabic', NULL, NULL, 0),
