(59, 'Aspirin ', 1, 1, 10, '2020-11-11 08:40:05', 32, 'AspirinProtect.mp4', '', 'Acetyl Salicylic Acid is commercially known as aspirin, and is available as tablets with different doses. We will focus on a low dosage of 100 mg which is known as Aspirin protect and is used in indications related to heart problems prevention.<br><br>Why is this drug used in low doses?<br>In low doses, Acetyl Salicylic Acid plays an important role in clot prevention among people at high risk. That is why it is called Aspirin Protect. <br>The high risk population includes those with coronary problems, those who already suffered from a heart attack, those who suffer from arterial fibrillation, or coronary syndrome.<br><br>What is its mechanism of action in preventing blood clots?<br>First, it works at reducing the inflammation at the artery level, through the inhibition of the cox 2 enzyme that produces prostaglandins, which plays a role in inflammation.<br>Second, it works on decreasing platelets aggregation through inhibiting the cox 1 enzyme that produces thromboxane, which plays a role in aggregation.<br><br>The daily dose of aspirin protect is one tablet to be taken with food in order to prevent stomach aches. It is important to know, that this drug is contraindicated for children below 16 years of age because it increases the risk of Reye syndrome which is characterized by cerebral inflammation and liver failure.<br><br>The side effects are dizziness, headache, rapid breathing, nausea, tachycardia, heartburn, stomach ache, as well as stomach hemorrhage. <br><br>What are the contra-indications?<br>women in their last three months of pregnancy, children below 16 years of age, hypersensitivity to Acetyl Salicylic Acid, stomach ulcer, hemophilia, renal failure, and concomitant use with methotrexate at doses above 15 mg weekly.<br>', 'Arabic', NULL, NULL, 0),
