(71, 'كايك القهوة', 1, 1, 10, '2020-11-14 07:19:44', 21, 'swcoffeecake.mp4', '', 'زبدة 	غرام	300<br>سكر بودرة	غرام	300<br>فانيليا	غرام	7.5<br>طحين	غرام	330<br>باكن بودر	غرام	15<br>بيض	غرام	300<br>برش حامض	غرام	20<br>كاكاو	غرام	50<br>طريقة التحضير<br>نضع الزبدة والسكر البودرة في الوعاء ونبدء بالعجن حتى تصبح عجينة ناعمة <br>ثم نضيف باقي المواد الناشفة وتعجن الى ان تصبح عجينة متناسقة ثم نضيف البيض ونكمل العجن دون الاكثار من العجن كي لا  تذوب العجينة <br>نحضر القالب بالدهن بالزبدة ثم ترش بالطحين جيدا أو نضع الورق الخاص بالمافين ونضع الخليط <br>نحمي الفرن على حرارة 180 درجة مئوية  ونضع القالب مدة ربع ساعة <br> يفحص القالب اذا نشف بواسطة قشة كبريت او مسواك ويترك في الفرن الى ان تنشف من الداخل<br>تخرج المافين من الفرن وتوضع جانبا الى ان تبرد<br>ملاحظة : اذا كنا نستعمل خفاقة تتغير طريقة التحضير ', 'Arabic', NULL, NULL, 0),
(72, 'كايك بالجوز', 1, 1, 10, '2020-11-14 07:20:37', 38, 'swcakenuts.mp4', '', 'بيض = نصف بيضة 	غرام	30<br>طحين	غرام	105<br>ملح	غرام	2<br>باكن بودر	غرام	2<br>فانيليا 	غرام	2<br>جوز  مكسر 	غرام	75<br>طريقة التحضير<br>نضع الزبدة ثم السكر ونخلط جيدا <br>ثم نضيف باقي المواد الناشفة  الى ان تصبح العجينة متماسكة <br>ثم نضيف البيض ونعجن الخليط الى ان تصبح العجينة متماسكة <br>تريح العجينة في البراد ثم تقطع حسب الرغبة وتوضعة في الصينية على ورق زبدة ثم تكبس بالشوكة  وتدخل الفرن<br>نحمي الفرن على حرارة 180 درجة مئوية  ثم يخفف الى 160 ونضع الصينية  مدة ربع ساعة او الى ان تنشف جيدا<br>تخرج من الفرن وتترك لتبرد وتقدم مع المشروبات الساخنة او الباردة حسب لاذوق', 'Arabic', NULL, NULL, 0),
(73, 'البريوش', 1, 1, 10, '2020-11-14 07:21:35', 21, 'swbrioche.mp4', '', 'زبدة ذائبة 	غرام 	300<br>طحين	غرام 	500<br>خميرة	غرام 	30<br>سكر	غرام 	35<br>ملح	غرام 	7<br>بيض 5 او 6 بيضات	غرام 	300<br>طريقة التحضير<br>نضع الخميرة مع القليل من الماء الفاترة الى ان تنبت <br>نضع باقي المكونات في وعاء العجن أو العجانة ونخلطهم جيدا ثم نضيف الخميرة المنبتة <br>نخلطهم جيدا  ثم نضيف الطحين ونعجنهم جيدا ثم نغطيهم بورقة نايلون وتترك مدة ساعة أو أكثر الى<br>أن تختمر جيدا  . تخرج من الوعاء ترش طاولة العمل بالطحين ونضع العجينة على الطاولة تلف جيدا <br>تقطع حسب الرغبة , نقطع الاقراص وتلف جيدا وتوضع في صينية الخبز وتترك لتختمر ثم ندهن <br>الوجه بالحليب السائل وتدخل الى الفرن على حرارة 180 درجة مئوية مدة 15 دقيقة ', 'Arabic', NULL, NULL, 0),
(74, 'البايغل', 1, 1, 10, '2020-11-14 07:22:33', 21, 'swbagel.mp4', '', 'طحين	غرام	480<br>خميرة ملعقة صغيرة	ملعقة صغيرة	2.5<br>بايكن باودر	ملعقة صغيرة	1<br>سكر أسمر 	غرام	50<br>ملح	غرام	7<br>زبدة	غرام	15<br>ماء دافئ	غرام	360<br>بيضة لدهن الوجه	بيضة	1<br>طريقة التحضير<br>تخلط الخميرة مع قسم من الطحين والسكر والماء لتنمو الخميرة ثم نضيف باقي المواد وتعجن جيدا وتترك نصف ساعة لتختمر العجينة ثم تقطع 65 غرام وتلف ثم تمد بالشوبك بشكل مستطيل وتطبق ثم تلف بشكل دائري وتوضع على ورق زبدة للخبز وتغطى باللنايلون وتترك لتختمر ثم تسلق بالماء الدافئ 10 ثواني من كل جهة ومن ثم توضع على ورق الفرن , يمكن أن نشوي البايغل من دون سلق أذا اردنا ,  تدهن بصفار البيض وترش بالسمسم وتخبز 15 دقيقة على حرارة 180  درجة  ', 'Arabic', NULL, NULL, 0),
