(1, 'المستندات الواجب ارفاقها بطلب الترشيح لامتحانات الكولوكيوم', '1- صورة عن بطاقة الهوية او اخراج القيد<br>\n \n2- رسم فوتوغرافي حديث عدد 2 - مصدق من المختار<br>\n \n3- صورة عن جواز السفر تظهر عليه الاقامة وختم الامن العام<br>\n \n4- نسخة مصدقة عن البكالوريا اللبنانية او ما يعادلها عدد 2<br>\n \n5- رسم مالي بموجب ايصال يدفع في وزارة المالية<br>\n \n6- الشهادة العلمية (طب عام، طب اسنان، صيدلة، تمريض، علاج فيزيائي، قبالة)<br>\n \n7- افادة مفصلة عن سنوات الدراسة تبين عدد السنوات مع المواد والعلامات<br>\n \n8- افادة تمرين لمدة 12 شهرا (لحائزي شهادة الطب العام او الصيدلة)<br>\n \n9- افادة تثبت ان الشهادة الممنوحة من خارج البلاد تسمح لصاحبها بمزاولة المهنة في بلد المصدر .<br>\n \n10- افادة معادلة لشهادة الاختصاص من دائرة المعادلات في وزارة الثقافة مبنى ستاركو.<br>\n \nالتصديقات :<br>\n\n· الشهادات والافادات الصادرة من جامعات ومعاهد واقعة داخل الاراضي اللبنانية مصدقة من مجلس التعليم العالي .<br>\n\n· الشهادات والافادات الصادرة عن جامعات ومعاهد خارج الاراضي اللبنانية مصدقة من :<br>\n \n1- وزارة الخارجية في بلد المصدر<br>\n \n2- السفارة اللبنانية في بلد المصدر<br>\n \n3- وزارة الخارجية اللبنانية<br>\n \nتقديم الطلبات :<br>\n\n· تقدم الطلبات للدورة الاولى طوال شهري ايار وحزيران ويجري الامتحان خلال شهر تموز<br>\n\n· للدورة الثانية طوال شهري تشرين الاول وتشرين الثاني ويجري الامتحان خلال شهر كانون الاول<br>\n\n· تقبل الطلبات ايام الاثنين والثلاثاء والاربعاء والخميس من كل اسبوع<br>\n\n· تلفون : 6/792387 - فاكس : 792388<br>\n \nآخر موعد لتقديم الطلبات هو 30 حزيران 2003 ، الامتحان في 16 تموز 2003', 'collapseOne', '1- صورة عن بطاقة الهوية او اخراج القيد<br>\n \n2- رسم فوتوغرافي حديث عدد 2 - مصدق من المختار<br>\n \n3- صورة عن جواز السفر تظهر عليه الاقامة وختم الامن العام<br>\n \n4- نسخة مصدقة عن البكالوريا اللبنانية او ما يعادلها عدد 2<br>\n \n5- رسم مالي بموجب ايصال يدفع في وزارة المالية<br>\n \n6- الشهادة العلمية (طب عام، طب اسنان، صيدلة، تمريض، علاج فيزيائي، قبالة)<br>\n \n7- افادة مفصلة عن سنوات الدراسة تبين عدد السنوات مع المواد والعلامات<br>\n \n8- افادة تمرين لمدة 12 شهرا (لحائزي شهادة الطب العام او الصيدلة)<br>\n \n9- افادة تثبت ان الشهادة الممنوحة من خارج البلاد تسمح لصاحبها بمزاولة المهنة في بلد المصدر .<br>\n \n10- افادة معادلة لشهادة الاختصاص من دائرة المعادلات في وزارة الثقافة مبنى ستاركو.<br>\n \nالتصديقات :<br>\n\n· الشهادات والافادات الصادرة من جامعات ومعاهد واقعة داخل الاراضي اللبنانية مصدقة من مجلس التعليم العالي .<br>\n\n· الشهادات والافادات الصادرة عن جامعات ومعاهد خارج الاراضي اللبنانية مصدقة من :<br>\n \n1- وزارة الخارجية في بلد المصدر<br>\n \n2- السفارة اللبنانية في بلد المصدر<br>\n \n3- وزارة الخارجية اللبنانية<br>\n \nتقديم الطلبات :<br>\n\n· تقدم الطلبات للدورة الاولى طوال شهري ايار وحزيران ويجري الامتحان خلال شهر تموز<br>\n\n· للدورة الثانية طوال شهري تشرين الاول وتشرين الثاني ويجري الامتحان خلال شهر كانون الاول<br>\n\n· تقبل الطلبات ايام الاثنين والثلاثاء والاربعاء والخميس من كل اسبوع<br>\n\n· تلفون : 6/792387 - فاكس : 792388<br>\n \nآخر موعد لتقديم الطلبات هو 30 حزيران 2003 ، الامتحان في 16 تموز 2003', 0),
(2, 'المستندات المطلوبة لتقديم طلب مزاولة مهنة الصيدلة', '1- اخراج قيد فردي مصدق من وزارة الداخلية (دائرة النفوس)<br>\n \n2- سجل عدلي أصلي<br>\n \n \n3- 4 صور شمسية مصدقة من المختار وممهورة بختمه<br>\n \n \n4- طوابع أميرية بقيمة 26 الف ل.ل<br>\n \n \n5- افادة نجاح في الكولوكيوم (صورة طبق الاصل مصدقة)<br>\n \n \n6- افادة لجنة المعادلات للتعليم العالي من وزارة التربية والتعليم العالي (صورة طبق الاصل مصدقة)<br>\n \n  \n\n7- في لبنان :<br><br>\n \n \n \nأ - افادة نجاح في شهادة البكالوريا - القسم الثاني ( صورة طبق الاصل مصدقة)<br>\n \n \nب - شهادة الصيدلة مصدقة من مجلس التعليم العالي<br>\n \n \nج - افادة بعلامات سنوات الدراسة مصدقة من مجلس التعليم العالي<br>\n \n \nد - افادة سنوات الدراسة للصيدلة مصدقة من مجلس التعليم العالي<br>\n \n \nه - افادة تمرين لسنة مصدقة من نقابة صيادلة لبنان<br>\n \n  \n\n8- خارج لبنان :<br>\n <br>\n \n \nأ - افادة لجنة المعادلات من وزارة التربية ( صورة طبق الاصل مصدقة)<br>\n \n \n- شهادة البكالوريا - القسم الثاني - مصدقة من وزارة الخارجية<br>\n \n \n- افادة بعلامات البكالوريا مصدقة من وزارة الخارجية<br>\n \n \nب - شهادة الصيدلة مصدقة من وزارة الخارجية مع صورة طبق الاصل مصدقة<br>\n \n \nج - افادة بعلامات سنوات الدراسة مصدقة من وزارة الخارجية مع صورة طبق الاصل مصدقة<br>\n \n \nد - افادة سنوات الدراسة للصيدلة مصدقة من وزارة الخارجية<br>\n \n \nه - افادة تمرين لسنة مصدقة من وزارة الخارجية مع صورة طبق الاصل مصدقة<br>\n \n \nو - افادة من سفارة البلد او الجامعة المعني تفيد ان تلك الشهادة طبق أصل للشهادة التي تعطيها الكليات المذكورة لابناء البلاد المنتسبة اليهم وان تكون مقبولة للعمل في تلك البلاد نفسها مصدقة من وزارة الخارجية مع صورة طبق الاصل عنها مصدقة .<br>\n \n  \n\nملاحظة :<br>\n <br>\n \n \n- يتم تقديم الطلب من قبل صاحب العلاقة فقط\n \n- يسلم امر القبض واجازة مزاولة مهنة الصيدلة فقط الى صاحب العلاقة ايام الخميس والجمعة.\n \n- لا يقبل الطلب اذا كان صاحب العلاقة مقيما خارج الاراضي اللبنانية.\n \n- يقدم الطلبات ايام الاربعاء ما بين الساعة 10 - 12 فقط\n \n- المراجعات ايام الخميس والجمعة ', 'collapsetwo', '1- اخراج قيد فردي مصدق من وزارة الداخلية (دائرة النفوس)<br>\n \n2- سجل عدلي أصلي<br>\n \n \n3- 4 صور شمسية مصدقة من المختار وممهورة بختمه<br>\n \n \n4- طوابع أميرية بقيمة 26 الف ل.ل<br>\n \n \n5- افادة نجاح في الكولوكيوم (صورة طبق الاصل مصدقة)<br>\n \n \n6- افادة لجنة المعادلات للتعليم العالي من وزارة التربية والتعليم العالي (صورة طبق الاصل مصدقة)<br>\n \n  \n\n7- في لبنان :<br><br>\n \n \n \nأ - افادة نجاح في شهادة البكالوريا - القسم الثاني ( صورة طبق الاصل مصدقة)<br>\n \n \nب - شهادة الصيدلة مصدقة من مجلس التعليم العالي<br>\n \n \nج - افادة بعلامات سنوات الدراسة مصدقة من مجلس التعليم العالي<br>\n \n \nد - افادة سنوات الدراسة للصيدلة مصدقة من مجلس التعليم العالي<br>\n \n \nه - افادة تمرين لسنة مصدقة من نقابة صيادلة لبنان<br>\n \n  \n\n8- خارج لبنان :<br>\n <br>\n \n \nأ - افادة لجنة المعادلات من وزارة التربية ( صورة طبق الاصل مصدقة)<br>\n \n \n- شهادة البكالوريا - القسم الثاني - مصدقة من وزارة الخارجية<br>\n \n \n- افادة بعلامات البكالوريا مصدقة من وزارة الخارجية<br>\n \n \nب - شهادة الصيدلة مصدقة من وزارة الخارجية مع صورة طبق الاصل مصدقة<br>\n \n \nج - افادة بعلامات سنوات الدراسة مصدقة من وزارة الخارجية مع صورة طبق الاصل مصدقة<br>\n \n \nد - افادة سنوات الدراسة للصيدلة مصدقة من وزارة الخارجية<br>\n \n \nه - افادة تمرين لسنة مصدقة من وزارة الخارجية مع صورة طبق الاصل مصدقة<br>\n \n \nو - افادة من سفارة البلد او الجامعة المعني تفيد ان تلك الشهادة طبق أصل للشهادة التي تعطيها الكليات المذكورة لابناء البلاد المنتسبة اليهم وان تكون مقبولة للعمل في تلك البلاد نفسها مصدقة من وزارة الخارجية مع صورة طبق الاصل عنها مصدقة .<br>\n \n  \n\nملاحظة :<br>\n <br>\n \n \n- يتم تقديم الطلب من قبل صاحب العلاقة فقط\n \n- يسلم امر القبض واجازة مزاولة مهنة الصيدلة فقط الى صاحب العلاقة ايام الخميس والجمعة.\n \n- لا يقبل الطلب اذا كان صاحب العلاقة مقيما خارج الاراضي اللبنانية.\n \n- يقدم الطلبات ايام الاربعاء ما بين الساعة 10 - 12 فقط\n \n- المراجعات ايام الخميس والجمعة ', 0),
(3, 'المستندات المطلوبة من الصيادلة اللبنانيين للانتساب للنقابة', '1.   صورة تذكرة الهوية. <br>\n2.   اخراج قيد عائلي لا يعود تاريخ إصداره لاكثر من ثلاثة أشهر.  <br>\n3.   اخراج قيد افرادي لا يعود تاريخ إصداره لاكثر من ثلاثة أشهر.   <br>\n4.   إفادة سكن من المختار تتضمن بان الصيدلي مقيم اقامة فعلية في لبنان.   <br>\n5.   شهادة الثانوية العامة - البكالوريا القسم الثاني (صورة طبق الاصل مصدقة) ، أو ما يعادلها مع العلامات. <br>\n6.   شهادة الصيدلة مصدقة من الجامعة ومن وزارة التربية والتعليم العالي.  <br>\n7.   إفادة معادلة شهادة الصيدلة من لجنة المعادلات في وزارة التربية والتعليم العالي (صورة مصدقة طبق الاصل). <br>\n8.   إفادة من الجامعة الصادرة عنها شهادة الصيدلة تثبت ان مدة الدراسة هي خمس سنوات مصدقة من وزارة التربية والتعليم العالي. <br>\n9.   إفادة 12 شهر تمرين في المؤسسة الصيدلانية التي اجري فيها التمرين والمسجلة في النقابة حسب الاصول \n            + افادة شهرين تمرين في المؤسسات الصيدلانية في لبنان (وذلك للصيادلة المتخرجين من خارج لبنان). <br>\n10.   برنامج مفصل عن المواد التي تابع دراستها خلال سنوات الدراسة (العلامات) مصدق من وزارة التربية والتعليم العالي. <br>\n11.   افادة الكولوكيوم من وزارة التربية والتعليم العالي (صورة طبق الاصل مصدقة).   <br>\n12.   سجل عدلي لا يعود تاريخ اصداره لاكثر من شهر. <br>\n13.   اجازة مزاولة مهنة الصيدلة في لبنان الصادرة عن وزارة الصحة العامة (صورة طبق الاصل مصدقة). <br>\n14.   تصريح خطي يوقعه طالب الانتساب يتعهد فيه بعدم مزاولة مهنة الصيدلة خارج لبنان الا بعد ابلاغ النقابة خطيا بذلك.<br>\n15.   رسم الانتساب وبدل الاشتراك السنوي (1.665.000) عند تقديم طلب الانتساب. <br>\n16.   اربع صور شمسية مصدق عليها من المختار. <br>\n17.   احضار افادة من الامن العام اللبناني وممهورة بختمه تثبت تاريخ الدخول والخروج( للصيادلة المتخرجين من خارج لبنان).  <br> <br>\n======================================================\nملاحظات عامة <br> <br>\n1 -  على الصيدلي طالب الانتساب الحضور شخصيا الى مركز النقابة لتقديم الطلب وتوقيعه امام الموظف المختص. <br>\n2 - على الصيدلي طالب الانتساب تسجيل اسمه لدى صندوق التقاعد الصيدلي وابراز نسخة عن اجازة مزاولة مهنة الصيدلة  في لبنان. <br>\n3 - كل صورة (Photocopy) لاي مستند يتوجب تصديقه من المرجع الصادر عنه <br>\n4 - كل صورة (Photocopy) لاي مستند صادر عن خارج لبنان يتوجب تصديقه من المرجع الصادر عنه ومن السفارة اللبنانية في الخارج ووزارة الخارجية. <br>\n5 - لا يقبل أي طلب انتساب ولا يسجل بقلم النقابة ما لم يكن مرفقا بكافة المستندات القانونية المطلوبة والمصدقة وفقا للاصول    ومستوفيا الشروط بكاملها. <br>\n6 - على الصيدلي طالب الانتساب الحضور شخصيا الى مركز النقابة لاستلام قرار قبول انتسابه للنقابة وبطاقة العضوية خلال قسم اليمين. <br>\n7 -  لا تقبل طلبات الانتساب للنقابة خلال شهر تشرين الثاني الا بعد انعقاد الجمعية العامة للنقابة التي تحدد رسم الانتساب للعام الجديد. <br><br>\n======================================================\nعنوان وارقام هاتف النقابة <br>\n بيروت - كورنيش النهر - بناية نقابة صيادلة لبنان - منطقة العدلية  <br>\nهاتف : 01611081 - 01611082   فاكس : 425247/01 - صندوق البريد : 5453 - 116 <br>\nمكتب النقابة في زحلة : جسر الياس الهراوي – حوش الامراء – طابق أرضي - هاتف وفاكس : 818192/08 <br>\n\nمكتب النقابة في صيدا : بولفار صيدا الشرقي – تجاه محطة الجردلي للمحروقات - عمارة التجهيز والبناء – هاتف وفاكس : 752411/07 <br>\nمكتب النقابة في طرابلس : شارع الجميزات – مجمع طرابلس – الطابق الاول -  هاتف وفاكس : 625382 06 <br>', 'collapsethree', '1.   	صورة تذكرة الهوية. <br>\n2.   اخراج قيد عائلي.  <br>\n3.   اخراج قيد افرادي.  <br>\n4.   شهادة اقامة صادرة عن المختار تتضمن بان الصيدلي مقيم اقامة فعلية في لبنان.  <br>\n5.   شهادة البكالوريا اللبنانية - القسم الثاني. <br>\n6.   شهادة الصيدلة ( الاطروحة Thèse اذا كانت موجودة)  <br>\n7.   إفادة معادلة شهادة الصيدلة من لجنة المعادلات في وزارة التربية والتعليم العالي. <br>\n8.   إفادة من الجامعة الصادرة عنها شهادة الصيدلة تثبت ان مدة الدراسة هي خمس سنوات.   <br>\n9.   إفادة 12 شهر تمرين في المؤسسة الصيدلانية التي اجري فيها التمرين والمسجلة في النقابة حسب الاصول + افادة شهرين تمرين في المؤسسات الصيدلانية في لبنان وذلك للصيادلة المتخرجين من خارج لبنان.  <br>\n10.   برنامج مفصل عن المواد التي تابع درسها خلال سنوات الدراسة (العلامات).  <br>\n11.   افادةالكولوكيوم من وزارة التربية والتعليم العالي.  <br>\n12.   سجل عدلي لا يعود تاريخ اصداره لاكثر من شهر <br>\n13.   اجازة مزاولة مهنة الصيدلة في لبنان الصادرة عن وزارة الصحة العامة.  <br>\n14.   تصريح خطي يوقعه طالب الانتساب يتعهد فيه بعدم مزاولة مهنة الصيدلة خارج لبنان الا بعد ابلاغ النقابة خطيا بذلك. <br>\n15.   ايصال بدفع رسم الانتساب وبدل الاشتراك السنوي بكامله . <br>\n16.   اربع صور شمسية مصدق عليها من المختار. <br>\n17.   احضار افادة من الامن العام اللبناني وممهورة بختمه تثبت تاريخ الدخول والخروج للصيادلة المتخرجين من خارج لبنان.  <br> <br>\n======================================================\nملاحظات عامة <br> <br>\n1 - على الصيدلي طالب الانتساب الحضور شخصيا الى مركز النقابة لتقديم الطلب وتوقيعه امام الموظف المختص . <br>\n2 - على الصيدلي طالب الانتساب تسجيل اسمه لدى صندوق التقاعد الصيدلي وابراز نسخة عن اجازة مزاولة مهنة الصيدلة  في لبنان. <br>\n3 - كل صورة (Photocopy) لاي مستند صادر عن خارج لبنان يتوجب تصديقه من المرجع الصادر عنه ومن السفارة اللبنانية في الخارج ووزارة الخارجية. <br>\n4 - لا يقبل أي طلب انتساب ولا يسجل بقلم النقابة ما لم يكن مرفقا بكافة المستندات القانونية المطلوبة والمصدقة وفقا للاصول    ومستوفيا الشروط بكاملها. <br>\n5 - على الصيدلي طالب الانتساب الحضور شخصيا الى مركز النقابة لاستلام قرار قبول انتسابه للنقابة وبطاقة العضوية خلال قسم اليمين <br>\n6 - لا تقبل طلبات الانتساب للنقابة خلال شهر تشرين الثاني الا بعد انعقاد الجمعية العامة للنقابة التي تحدد رسم الانتساب للعام الجديد <br> <br>\n======================================================\nعنوان وارقام هاتف النقابة <br>\n بيروت - كورنيش النهر - بناية نقابة صيادلة لبنان - منطقة العدلية  <br>\nهاتف : 01611081 - 01611082   فاكس : 425247/01 - صندوق البريد : 5453 - 116 <br>\nمكتب النقابة في زحلة : جسر الياس الهراوي – حوش الامراء – طابق أرضي - هاتف وفاكس : 818192/08 <br>\n\nمكتب النقابة في صيدا : بولفار صيدا الشرقي – تجاه محطة الجردلي للمحروقات - عمارة التجهيز والبناء – هاتف وفاكس : 752411/07 <br>\nمكتب النقابة في طرابلس : شارع الجميزات – مجمع طرابلس – الطابق الاول -  هاتف وفاكس : 625382 06 <br>', 0),
(4, 'المستندات المطلوبة لفتح واستثمار صيدلية جديدة', 'كتاب من الصيدلي يشتمل على عنوان الصيدلية ملصق عليه طابع أميري بقيمة الف ليرة لبنانية (قانون الطوابع) مرفق به المستندات التالية : <br>\n \n1- رسم موقع الصيدلية وترتيباتها الداخلية (المادة 10 - الفقرة 1) من قانون مزاولة مهنة الصيدلة ، وخريطة عن مساحة الصيدلية (الطابق الارضي) موقعة من مهندس ومصدقة من نقابة المهندسين . <br>\n \n2- عقد الايجار (المادة 10 - فقرة 3) من قانون الصيدلة، مسجل ومصدق من رئيس البلدية، وفي حال عدم وجود بلدية يصدق من القائمقام . <br>\n \n3- تصريح خطي من الصيدلي يفيد بأن الصيدلية موضوع الطب هي ملكه بكاملها وانه يديرها لحسابه وليس اسمه مستعارا فيها (المادة 10 - فقرة 4) من قانون الصيدلة . <br>\n \n4- ثلاث صور فوتوغرافية للصيدلي صاحب الطلب(المادة 10 - فقرة 5) من قانون الصيدلة مصدقة من المختار وممهورة بختمه . <br>\n \n5- طابع اميري بقيمة 25 الف ليرة لبنانية (قانون الطوابع) <br>\n \n6- تصريح خطي بأن الصيدلي صاحب الطلب لا يعمل بأي مؤسسة صيدلانية وان لا يقوم باي عمل متصل بمهنته، كما انه ليس له مصلحة في صيدلية اخرى غير صيدليته (المادة 11 من قانون الصيدلة) وأنه اطلع على المرسوم رقم 2622 تاريخ 19/8/1992 المتعلق بتحديد الشروط والمواصفات الفنية للصيدليات ومستعد لتطبيقه\n <br> \n7- افادة بسكن الصيدلي صاحب الطلب ( المادة 18 من قانون الصيدلة). <br>\n \n8- السجل التجاري للصيدلية مع الكتاب المقدم من الصيدلي للحصول على هذا السجل <br>\n \n9- صورة طبق الاصل مصدقة عن اجازة مزاولة مهنة الصيدلة . <br>\n \n10- صورة طبق الاصل مصدقة عن افادة انتساب الصيدلي لنقابة صيادلة لبنان. <br>\n \n11- في حال وجود شركاء صيادلة يطلب نظام الشركة مسجل اصولا وكتاب من الصيدليين والسجل التجاري مقدم من الشريكين، عقد الايجار باسم الشركاء أو احدهما مسجل ومصدق لدى البلدية . <br>\n \n12- افادة بالمسافة من مساح محلف بين الصيدلية المنوي انشاؤها وأقرب صيدلية. <br>\n \n13- اخراج قيد مصدّق. <br>\n \n14- سجل عدلي. <br>\n \n15- لا يقبل الطلب في حال لم تكن كافة المستندات المطلوبة كاملة', 'collapsefour', 'كتاب من الصيدلي يشتمل على عنوان الصيدلية ملصق عليه طابع أميري بقيمة الف ليرة لبنانية (قانون الطوابع) مرفق به المستندات التالية : <br>\n \n1- رسم موقع ا