(5, 'المستندات المطلوبة لشراء صيدلية', 'كتاب مقدم من الصيدلي يشتمل على عنوان الصيدلية ملصق عليه طابع اميري بقيمة 1000 ل.ل (قانون الطوابع ) مرفق به المستندات التالية :<br><br>\n \n1- صورة عن رخصة الصيدلية مع طابع اميري بقيمة 1000 ل.ل.<br>\n \n2- عقد الايجار (المادة العاشرة فقرة 3) من قانون الصيدلة مصدق ومسجل في البلدية او سند تمليك<br>\n \n3- تصريح خطي من الصيدلي يفيد بأن الصيدلية موضوع الطلب هي ملكه بكاملها وأنه يديرها لحسابه وليس اسمه مستعارا فيها ( المادة العاشرة فقرة 4) من قانون الصيدلة .\n \n(طابع بـ 1000 ل.ل)<br>\n \n4- ثلاث صورة فوتوغرافية للصيدلي صاحب الطلب ( المادة العاشرة فقرة 5) من قانون الصيدلة مصدقة من المختار وممهورة بخاتمه .<br>\n \n5- السجل التجاري والطلب المقدم للمحكمة .<br>\n \n6- طابع اميري بقيمة /25.000/ ل.ل. (قانون الطوابع )<br>\n \n7- تصريح خطي بان الصيدلي صاحب الطلب لا يعمل بأي مؤسسة صيدلانية وانه لا يقوم بأي عمل متصل بمهنته ، كما أنه ليس له مصلحة في صيدلية اخرى غير صيدليته (المادة 16 من قانون الصيدلة ) وانه اطلع على المرسوم رقم 2622 تاريخ 29/8/1992 المتعلق بتحديد الشروط والمواصفات الفنية للصيدليات ومستعد لتطبيقه وطابع بقيمة /1000/ل.ل.<br>\n \n8- صورة عن مزاولة مهنة الصيدلة ( طابع بقيمة 1000 ل.ل.)<br>\n \n9- صورة مصدقة عن انتساب النقابة<br>\n \n10- سجل عدلي<br>\n \n11- اخراج قيد<br>\n \n12- افادة سكن<br>\n \n13- خريطة الصيدلية مصدقة من نقابة المهندسين للصيدلي الشاري<br>\n \n14- لا يقبل الطلب في حال لم تكن كافة المستندات المطلوبة كاملة .<br>', 'collapsefive', 'كتاب مقدم من الصيدلي يشتمل على عنوان الصيدلية ملصق عليه طابع اميري بقيمة 1000 ل.ل (قانون الطوابع ) مرفق به المستندات التالية :<br><br>\n \n1- صورة عن رخصة الصيدلية مع طابع اميري بقيمة 1000 ل.ل.<br>\n \n2- عقد الايجار (المادة العاشرة فقرة 3) من قانون الصيدلة مصدق ومسجل في البلدية او سند تمليك<br>\n \n3- تصريح خطي من الصيدلي يفيد بأن الصيدلية موضوع الطلب هي ملكه بكاملها وأنه يديرها لحسابه وليس اسمه مستعارا فيها ( المادة العاشرة فقرة 4) من قانون الصيدلة .\n \n(طابع بـ 1000 ل.ل)<br>\n \n4- ثلاث صورة فوتوغرافية للصيدلي صاحب الطلب ( المادة العاشرة فقرة 5) من قانون الصيدلة مصدقة من المختار وممهور