(6, 'المستندات المطلوبة لنقل موقع صيدلية', '1- كتاب من الصيدلي يفيد عن أسباب نقل صيدليته مع العنوان الكامل للصيدلية الجديدة ورقم الهاتف ممهور بختمه وعليها طابع اميري بقيمة الف ليرة لبنانية.<br>\n \n2- ثلاث صور شمسية مصدقة من المختار.<br>\n \n3- طوابع أميرية بقيمة 25 الف ليرة لبنانية<br>\n \n4- اخراج قيد فردي مصدق حسب الاصول<br>\n \n5- سجل عدلي<br>\n \n6- افادة سكن<br>\n \n7- صورة طبق الاصل عن رخصى الصيدلية<br>\n \n8- براءة ذمة من وزارة المالية صالحة لنقل موقع الصيدلية<br>\n \n9- براءة ذمة من البلدية صالحة لنقل موقع الصيدلية<br>\n \n10- براءة ذمة من الضمان صالحة لنقل موقع الصيدلية<br>\n \n11- تعديل السجل التجاري مع الطلب المقدم لتعديل موقع الصيدلية وفي حال تغيير الاسم التجاري للصيدلية يجب تعديل السجل التجاري ايضا<br>\n \n12- افادة بالمسافة بين موقع الصيدلية الجديدة واقرب صيدلية لها مع ذكر اسمها:<br><br>\n \nأ - من مساح محلف مصدقة من نقابة الطبوغرافيين في لبنان<br>\n \nأو\n \nب - من مهندس خبير بالمساحة مصدقة من نقابة المهندسين<br>\n \n13- أ - سند الملكية باسم الصيدلي صاحب الطلب مع نسخة عنه\n \nأو<br>\n \nب - سند الايجار الاصلي مسجل في البلدية تحت رقم وتاريخ، وموقّع من رئيس البلدية وممهور بختمه مع صورة طبق الاصل عنه موقعة وممهورة من رئيس البلدية ( في حال عدم وجود بلدية يصدق من قائمقام او محافظ)<br>\n \n14- رسم بموقع الصيدلية وترتيباتها الداخلية تبين مساحة الصيدلية الارضية، اسم المالك ، اسم الصيدلي صاحب الطلب ، رقم العقار موقعة من مهندس ومصدقة من نقابة المهندسين .\n <br>\nملاحظة :<br><br>\n \n- لا يقبل الطلب في حال لم تكن المستندات المطلوبة كاملة<br>\n \n- يتم تقديم الطلب من قبل صاحب العلاقة فقط<br>\n \n- يسلم امر القبض واجازة فتح واستثمار الصيدلية الى صاحب العلاقة فقط ايام الخميس والجمعة<br>\n \n- تقدم الطلبات ايام الاثنين والثلاثاء ما بين الساعة 10 و12 فقط<br>\n \n- المراجعات ايام الخميس والجمعة .', 'collapsesix', '1- كتاب من الصيدلي يفيد عن أسباب نقل صيدليته مع العنوان الكامل للصيدلية الجديدة ورقم الهاتف ممهور بختمه وعليها طابع اميري بقيمة الف ليرة لبنانية.<br>\n \n2- ثلاث صور شمسية مصدقة من المختار.<br>\n \n3- طوابع أميرية بقيمة 25 الف ليرة لبنانية<br>\n \n4- اخراج 