(7, 'شروط فتح صيدلية داخل مستشفى', '1- نسخة عن رخصة المستشفى<br>\n \n2- طلب من مدير المستشفى باتخاذ صيدلي قانوني<br>\n \n \n3- طلب من الصيدلي بالموافقة<br>\n \n \n4- افادة انتساب الصيدلية لنقابة الصيادلة<br>\n \n \n5- نسخة عن اجازة مزاولة مهنة الصيدلة<br>\n \n \n6- تعهد من المستشفى والصيدلي بعدم بيع الدواء من العموم<br>\n \n \n7- خريطة عن موقع الصيدلية داخل المستشفى مصدقا من نقابة المهندسين<br>\n \n \n8- طوابع بقيمة 25 الف ليرة<br>\n \n \n9- تعهد الصيدلي بعدم مزاولة اي مهنة صيدلانية اخرى<br>\n \n \n10- عقد عمل بين الصيدلي والمستشفى<br>\n \n \n11- سجل عدلي للصيدلي<br>\n \n \n12- اخرا قيد افرادي للصيدلي<br>\n ', 'collapseseven', '1- نسخة عن رخصة المستشفى<br>\n \n2- طلب من مدير المستشفى باتخاذ صيدلي قانوني<br>\n \n \n3- طلب من الصيدلي بالموافقة<br>\n \n \n4- افادة انتساب الصيدلية لنقابة الصيادلة<br>\n \n \n5- نسخة عن اجازة مزاولة مهنة الصيدلة<br>\n \n \n6- تعهد من المستشفى والصيدلي بعدم بيع الدواء من العموم<br>\n \n \n7- خريطة عن موقع الصيدلية داخل المستشفى مصدقا من نقابة المهندسين<br>\n \n \n8- طوابع بقيمة 25 الف ليرة<br>\n \n \n9- تعهد الصيدلي بعدم مزاولة اي مهنة صيدلانية اخرى<br>\n \n \n10- عقد عمل بين الصيدلي والمستشفى<br>\n \n \n11- سجل عدلي للصيدلي<br>\n \n \n12- اخرا قيد افرادي للصيدلي<br>\n ', 0),
(8, 'شروط فتح واستثمار مستودع أدوية', '1- طلب رسمي مشتمل على عنوان المستودع كاملا والاسم التجاري للمستودع وتحديد مركز الشركة في مركز المستودع .<br>\n \n2- نسخة مصدقة عن اجازة مزاولة مهنة الصيدلة في لبنان<br>\n \n3- افادة انتساب الى نقابة صيادلة لبنان<br>\n \n4- صورة اخراج قيد مصدقة حسب الاصول<br>\n \n5- 3 صور فوتوغرافية مصدقة<br>\n \n6- نسخة عن السجل العدلي<br>\n \n7- رسم موقع المستودع وترتيباته الداخلية مصدق من نقابة المهندسين<br>\n \n8- تصريح من الصيدلي بالتفرغ بالادارة الفنية للمستودع . طابع ب/ألف ليرة<br>\n \n9- شهادة تسجيل المستودع في السجل التجاري لدى محكمة الدرجة الاولى باسم الصيدلي او الشركة مع الطلب المقدم للمحكمة التجارية .<br>\n \n10-نسخة عن سند الايجار باسم الصيدلي اوالشركة مصدق لدى البلدية<br>\n \n11-عنوان المستودع التجاري<br>\n \n12-تصريح من الصيدلي بعدم مزاولة اية مهنة صيدلانية اخرى . طابع ب/الف ليرة<br>\n \n13-افادة سكن من مختار المحلة<br>\n \n14-سجل عدلي\n <br>\n15-اخراج قيـد<br>\n \n16-نظام الشركة مسجل لدى السجل التجاري كما يجب ان يذكر في موضوع نظام الشركة ان موضوع التجارة هي تجارة الادوية والاشياء المباعة في الصيدليات فقط.<br>\n \n17-يطلب موافقة وزارة الصحة في حال انشاء فروع اخرى للمستودع او نقل المركز الى مكان آخر .<br>\n \n18-براءة ذمة مالية ، بلدية ، ضمان<br>\n \n19-طوابع ب/25 الف ليرة<br>\n \n20-صورة عن رخصة المسودع طابع ب/الف ليرة<br>\n \n21- لا يقبل الطلب في حال لم تكن كافة المستندات المطلوبة كاملة<br>', 'collapseeight', '1- طلب رسمي مشتمل على عنوان المستودع كاملا والاسم التجاري للمستودع وتحديد مركز الشركة في مركز المستودع .<br>\n \n2- نسخة مصدقة عن اجازة مزاولة مهنة الصيدلة في لبنان<br>\n \n3- افادة انتساب الى نقابة صيادلة لبنان<br>\n \n4- صورة اخراج قيد مصدقة حسب الاصول<br>\n \n5- 3 صور فوتوغرافية مصدقة<br>\n \n6- نسخة عن السجل العدلي<br>\n \n7- رسم موقع المستودع وترتيباته الداخلية مصدق من نقابة المهندسين<br>\n \n8- تصريح من الصيدلي بالتفرغ بالادارة الفنية للمستودع . طابع ب/ألف ليرة<br>\n \n9- شهادة تسجيل المستودع في السجل التجاري لدى محكمة الدرجة الاولى باسم الصيدلي او الشركة مع الطلب المقدم للمحكمة التجارية .<br>\n \n10-نسخة عن سند الايج