(9, 'المستندات المطلوبة من الصيدلي بائع صيدليته', '1- كتاب مقدم من الصيدلي يذكر فيه عنوانه الكامل ملصق عليه طابع اميري بقيمة 1000 ل.ل ( قانون الطوابع)<br>\n \n2- صك البيع والشراء المصدق حسب الاصول مع صورة مصدقة طبق الاصل<br>\n \n3- براءة ذمة شاملة صادرة عن الصندوق الوطني للضمان الاجتماعي تثبت ان الصيدلية بريئة تجاه الصندوق الوطني من اي دين ( النسخة الاصلية او صورة مصدقة طبق الاصل )<br>\n \n4- براءة ذمة من وزارة المال تثبت ان الصيدلية بريئة تجاه وزارة المال من اي دين بما في ذلك من اي ضريبة مترتبة من جراء البيع والشراء ( النسخة الاصلية او صورة مصدقة طبق الاصل)<br>\n \n5- براءة ذمة من البلدية ( النسخة الاصلية او صورة مصدقة طبق الاصل )<br>\n \n6- صورة طبق الاصل عن خريطة الصيدلية المصدقة من نقابة المهندسين (الصيدلي البائع)<br>', 'collapsenine', '1- كتاب مقدم من الصيدلي يذكر فيه عنوانه الكامل ملصق عليه طابع اميري بقيمة 1000 ل.ل ( قانون الطوابع)<br>\n \n2- صك البيع والشراء المصدق حسب الاصول مع صورة مصدقة طبق الاصل<br>\n \n3- براءة ذمة شاملة صادرة عن الصندوق الوطني للضمان الاجتماعي تثبت ان الصيدلية بريئة تجاه الصندوق الوطني من اي دين ( النسخة الاصلية او صورة مصدقة طبق الاصل )<br>\n \n4- براءة ذمة من وزارة المال تثبت ان الصيدلية بريئة تجاه وزارة المال من اي دين بما في ذلك من اي ضريبة مترتبة من جراء البيع والشراء ( النسخة الاصلية او صورة مصدقة طبق الاصل)<br>\n \n5- براءة ذمة من البلدية ( النسخة الاصلية او صورة مصدقة طبق الاصل )<br>\n \n6- صورة طبق الاصل عن خريطة الصيدلية المصدقة من نقابة المهندسين (الصيدلي البائع)<br>', 0),
(10, 'المستندات المطلوبة لالغاء اجازة فتح واستثمار صيدلية', '1- كتاب من الصيدلي بالغاء رخصة الصيدلية ( طابع بقيمة الف ليرة لبنانية)<br>\n \n2- براءة ذمة مالية لالغاء رخصة الصيدلية<br>\n \n3- براءة ذمة ضمان لالغاء رخصة الصيدلية<br>\n \n4- براءة ذمة بلدية لالغاء رخصة الصيدلية<br>\n \n5- صورة طبق الاصل عن رخصة الصيدلية<br>', 'collapseten', '1- كتاب من الصيدلي بالغاء رخصة الصيدلية ( طابع بقيمة الف ليرة لبنانية)<br>\n \n2- براءة ذمة مالية لالغاء رخصة الصيدلية<br>\n \n3- براءة ذمة ضمان لالغاء رخصة الصيدلية<br>\n \n4- براءة ذمة بلدية لالغاء رخصة الصيدلية<br>\n \n5- صورة طبق الاصل عن رخصة الصيدلية<br>', 0),
