INSERT INTO `trainings` (`Id`, `Title`, `Overview`, `NumberOfModules`, `Days`, `Level`, `Language`, `Category`, `File`, `Status`) VALUES
(1, 'Fundamentals of NGOs and Social Enterprises'' Actions', '<p><b>5 days in total in order to discover and acquire the knowledge and skills on how social and humanitarian organizations'' tackle the populations most pressing needs, and to understand how international and local development actors are managing their programs in real life situation.</b></p>\r\n<p>\r\n\r\n\r\nThe module 1: consists of 3 theoretical training days to get the knowledge on general concepts in social entrepreneurship: human centered design; defining mission, vision, and value; and the theory of change. You will get also get an introduction about the country specific challenges (Lebanon) and the main development actors working to address these challenges.</p>\r\n<p>\r\n\r\nModule 1 takes place as face to face sessions in Beirut offices (possible also through virtual class).</p>\r\n<p>\r\n\r\n\r\n\r\nThe module 2: consists of 2 training days that take place in the field:  you will be able to choose a non-for-profit organization among a selection of organizations working in the development sector in Lebanon. You will be able to get an immersive real-time experience as you accompany the organizations'' staff working on programs on the field to address the needs of the most vulnerable.</p>\r\n<p>\r\n\r\nModule 2 takes place in the field in Lebanon.</p>\r\n<p>\r\n\r\nAfter completion of the training, you will get a certificate of participation.</p>', '2 Modules', '5 Days', 'Intermediate', 'English', 'Training', 'banner2.jpg', 1),
(16, 'Agri-food ', '<p>The Business Support program in agri-food will enable the entrepreneur to gain knowledge and skills in technical and business fields.</p><p><br></p><p>The agri-food business program includes the following fields: Food processing, dairy production, Bakery works, pastry, and food preparation.&nbsp;</p><p><br></p><p> The applicants will be contacted to know more about their business needs, and provide them with the right coaching and support services.</p>', '1 Module', '30 Days', 'Idea stage or start-up', 'Arabic', 'Business Support', 'Food-Processing-Technology.jpg', 1);
